import Layout from '../src/components/Layout';
import { Cookies } from 'react-cookie';

//components
import Nav from '../src/components/dashboard/Nav';
import Jumbo from "../src/components/dashboard/Jumbo";
import Footer from '../src/components/dashboard/Footer';

const cookies = new Cookies();

const home = () => {
    return (
        <Layout>
            <div className='main'>
                <Nav />
                <Jumbo />
                <div className='cards'>
                    <div className='card'>

                    </div>
                    <div className='card'>

                    </div>
                    <div className='card'>

                    </div>
                    <div className='card'>

                    </div>
                </div>
                <Footer/>
            </div>
            <style global jsx>{`
                html,
                body,
                body > div:first-child,
                div#__next,
                div#__next > div,
                div#__next > div > div {
                    height: 100%;
                }

                *{
                    box-sizing: border-box;
                }

                .main{
                    width: 100%;
                    height: 100%;
                    background: linear-gradient(180deg, #C2C0C0, white);
                }   

                .cards{
                    width: 100%;
                    height: 30%;
                    margin-bottom: 220px;
                    border: 1px solid;
                    display: flex;
                    flex-direction: row;
                }      

                .cards .card{
                    width: 100%;
                    height: 80%;
                    border: 1px solid;
                }
            `}</style>
        </Layout>
    );
}

export default home;
